import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row'


function Skills(){
    return (
      <div>
        <h5 className="font-weight-bolder">Here Are Some Of My Skills</h5>

        <Container fluid={true} className="margins p-4 justify-content-center">
          <h6 className="orange-gradient">Fluent</h6>
          <Row className = 'd-flex flex-row ml-auto'>
            <small>Python | C/C++ | Java | Swift | SwiftUI | IOS | C# | SQL | HTML | CSS | Bootstrap | Firebase</small>
          </Row>
          <br/>

          <h6 className="lead">Familiar</h6>
          <Row className = "d-flex flex-row ml-auto">

          </Row>

        </Container>
      </div>
    );
}

export default Skills;
